export const REGISTERED_ACCESSORIES: Accessory[] = [
    {
        id: 'afasf',
        name: 'hoodie',
        imageUrl: ''
    }
];

export const REGISTERED_USERS: User[] = [
    {
        id: 'abc',
        name: 'Alex',
        likeAccessories: [],
    }
];

export interface User {
    id: string;
    name: string;
    likeAccessories: Accessory[];
}

export interface Accessory {
    id: string;
    name: string;
    imageUrl: string;
}
